@pq, moving this into M36. There are ~2 issues in the IntelliJ code we should address, even taking into account the fix in flutter_tools:

- FlutterSamplesManager can fire start many copies of `flutter create --list-samples` in parallel
- FlutterSamplesManager lets the process run indefinitely (it should have a hard limit of something like 30 seconds, to account for the older flutter_tools)
